-- Note for Translators
--	- Keeping Locdata separate from UI Translations. As Locdata keeps evolving and UI stays quite stable
--  - It's a long list. And for translators to know which entries have been updated since last translation pass is a pain
--  - Idea to make it easier: Github repo and locdata versioning
--		- Version number for locdata independent of Addon Version number
--  	- Whenever I upload updated location data to esoui. I as well commit it to github.
-- 		- Github diff should allow translators to easily see what entries have changed since last time they did a translation pass
-- 		- Repo info: https://github.com/remosito/displayleads-locdata-en   
--  - The "TRUE", "FALSE" entries should not be translated. I need them in english and they are not getting displayed anyway.

-- Locdata version : 0.0.1   

